import React, { Component } from 'react';

class PlaylistItem extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-2">
                    <img src={this.props.videoThumbnail} style={{ height: "50px", backgroundColor:"white" }}></img>
                </div>
                <div className="col-10">{this.props.videoTitle}</div>
            </div>
        );
    }
}

export default PlaylistItem;
